ࠛࡃࠋࠇࡆ࡟ࡗ࡞ࠡ࡞ࡖࡍࠐࠒ࣡ࠒ࣢ࠚ࣢࡙ࣧࠝࣤࣤ࠲࡛ࠛࡀࠕࠇࠕࠖࠎࠈࠓࠍࡉࠍࠌࠚࣣࠏ࣢ࡐ࣠࠘ࡓࣨࠚ࣮࣫ࡘࣰࣣࠔࠉࡂࠑࠓࠎ࠙ࠌࡊࡕࡌࠎࠛࠛ࣢ࠔࠞࣥࡔ࠭ࡖࠐࠒ࡙ࠦଝ୺ଫସଡଐ୴ଔଷୱମ଀ନ୭ଷହଜଇ଍ଧ଩ପଢ଼ଡ୙ଥ୞ଡ଼ତ୷୺ଡ଼ୁ୕ପିୗ଱ଶ଄࡙଑୻୻ୂଁ୼ାଚ୿ିଵୌଐଠଜଂପସ୼ଲ୅୒ଢୌିଷ୏ନଡ଼࡜ଊ୳୾௠ଘ୻ୃଛେ௣௠଀ଢ଼୮୧୫଻୦୫ୂୃଠ୑ଲୈଡ଼ଡ୔ଷ୕୉଺ࠢଙହ௦୅௣୺ୱ୴୲୶୚ଇ୛୑ଂୁୀ୛ଳ୚ଇ୘୏୞୑ࠡଳ௣଺଺୾௡ୈୡ଍ଥ଒୿୛ଡ଼୚ଢଡ଼୓ସ୑࡛଑ଙ୴ରୂଟ୵ଆଓଆଢତ଴୙୸ଫଶୄ୘୕଺ଣିଢ଼࡙ୱକଝ୿ୱଧପଣ୓ାୖ଼ଧଢ଼ଁନࡏଥ୯ମ଑େଉ୐ଊ୅ସଥ୒୑ସ୆ଢ଼ଫ୒ଁଥଥ଍ଧବ୑଩୎ࡐ୮୾଀୳ହଃ୫଒୻ଽ୹୐ଥ଩୑୛ଈࠢଛ௡௦ଃ௥௠୤୼ଂ୘ୋୋ୑଻ଂ୍ଲୋ୕ଵଈଫଡ଼ସ଀୊ଥࠣଈ୷௥଄ୂ୰ଌ୥୽୤ଢଉ୭୻ଘଖକ଩ଋ଍ରଏେ୉ଇ଍ࠣଵ௢௣ୂ௢୻ହୗ୾ଅ୞୽ଢୗଣା୐୕࡛ଲ୷୹ଙାର୸௤௣ଶ଄୅଼ଣ୨ଦଉଳୌଃଧ୞୕ୖ଴ୗ୐୆୔୍୐୏ଢଢ୒ଽ୚ࠦ௥଑୯ୢ୮଩୪୪ଏ୰୺଀ଗଣ଄୐୔ଠଉୗଡତଠଧଉ୏୍ࠦଟଆ୴୫୳୳୹୸୷୪ଖ୾଍଻ୂଦ୅୎୎୉ଡ଼୐ଣୟଧࠦଊ୆୲ଫାଂତୀ଀୙୙୏ତ୑࡚୳ି୰୼୵କ୅୵ଵକକଠ଺ଃ୓ୀ୏ପ଱୻଴ࡕ଒଴୵୾୶ଙଫଝଗଳରୃ୴଀୸୅௣୍୔ଽୗ୔୉୼ଳଫଽରଶିଲ୒ଦ୞ଶ୐࡟୺୳ସ୿ମ୒ଙଥ୚୿ଯଶହଢ଼ୃ୕୾ୋୗଦୁଁ࡛ଅଘ୳୲ାଗ୷ୖଔବଲାୗ୾୐ୀ୏ࡒଓ୵଍଑ଆೳ୍ୂ୞ଳପଡଡ଼ࠠ୆ଆେ௥଺୅ଉଝଊ଼୼଴ଊ୬ୈଡ଼ଈଊଈ଄୚ଲ࡜୿କ୴଼ି୎ସ଍଴ଛମ଱୕ଂଯଽ୓୏୒଀୕୛ଥଅ୏୚଩ଽ଄ସ଺୞ࠢ௢௤ଞ଄ୌୃୢଥି୙୛ୌ୛୚ୗ୿ତ୊ୂ୊୛ୈଉି୏଻୘୚ࠤଇଞଉ୿଄଄୩୶ଆଂଇ୑ୖ୿ଣଳଳୖ୍଄୏େࠠା୆୺୅଒ଂ୻ଙୖହୄଣହଳ଴଴ୈ଼ୃଳଦୗ଄୕࡞ଞଽ୹ଋ୅ୀ௥ଟଋ୾୞୪୳୧୚୆ଆୈଭୗ୊୐࡚ଙ଑ବ୿କଛ୻ଝ୼ଆ௠୒ଋୃଣୢ଺ଃ଼ବ୏ୀ଼ࡗ୶ନାଯ଺଒ଓଈଘୁଟ௡ଳ௤୺ଅସିଡ୙ଃତ୞୆ୀଣ୎୎ଅ୒୍ଢ଼ଂଢ୊ଌଌࠢୈ୆ଶ୻୺କ୬ଌନ୧୧଀଎ଦଫଢ଼ଫ୆ଡଉଢ଼ନଅ୎ଈଡଈ୙ࠤ୷ୌ௢ୌୁୈ଺୸ଥ୑଻୔ଂଂ୊ଧହୋଧଈ୛୏଺ୗୟࠣେ୷େୄଅଋ୥୴୫୸଱୭୭ସଆ୿ତ଀଻୍୍େବଢ଼ଦଣ୘୙ଲଣଳଁଶ୹୑ࡑପଧ଍଎଺୩୪଩ଘ୿୾଒ଧ଩ବ୐୊୍଻ଲଥࠧେୢଳ୬ଵ୳ଓଁ଎ଓଌ଻଑ଶ୽ଓ୼ିନୟ୏୊ାୖରଁ୒଍ଵ୾ࡐ୩ଐଣଏୱ୻୮ପଡେ୕ଡ଼୍ଠ୚ࠠ୅ଞୄ୸ଶଜ୼଻୔ଂ୍େ୒ୂଠଯୗଥଦ୊ି୘୅ଷଫଇ୎ୋࠢଆ௣୑଼଄୾ଂ୶୏୹ଠସ଴ବ୚୘ଥ଀࡚ବ୹୵ଜଘଉ଄ି୶ୈଵାଅ௤ଠ୶ୃ୻୎ୄହଡ୘ୁୀଧଦ࡛ୱଝ଀୼ଟଃ௡୉௣ଝ଻୹ଅଋ୫୫୨ଂ୚ଢ଼ୈୈ୙ିରଡ଼୓଻࡝୵ଯଯୂ୅୷ୈ୆୅௡ୂବ୯ଭ୮୫ଯୀ୉ଆଅ୅ଣୖ୐୞ଉ୆ଡ଼୎଼ଡࠣେ଻ଏ୺ୈ୰ବ୼ୣ୶ଔେଧଠ୊ଈ୊ଆ଺ୌୋପଣ୍ࠠ୵ୀଚଂଵ௣௨ଲତୢୣ଍୰୳ସଋ୸୲ଈଢ೶ଣଏ୔ଊ୘଼଻ଣଠࠥ௥୉୾ଫ୤ଦମ୥ଏକହ୳ଉାଢ଼୕୞ଡ୔଩ସୖ଀଎ୌତୖଡଫࠨ୧ୟ଍଑଑୹୶୧ଖଓଶ୮଒୼ରଆି଱ନକ଩ଠଃଅ୞ୗଂ୅୷୞୐ସଳ୼ࡕ୫ଳୄଏ଼୭ଜ୵ଙଵସ୺୼ଆଘଓଙଭ୙ଶଷୀ୆୞୅ୃ଺ࡖଫ଺ଷ୭଍୉೸୒ୖମୌୋ୍ଣ଑ଧତࠨ୮ଆ୴ଆୱ୷୯ଋଅସଈଁିଦଡ୆୉ଇ଀ଥରଽࠤଚ୉ୈୌ୳ୡ଎୷଎଒୸୸ଥ୵ଧଃଠଃ୆ୟଽ࡟଼ଷଲ଀ଜ୹ଇ଺ଚ୚ୌୋନା୐ࡔପହ୷ଶ୭୻ୁ୵ଧଦଥ଒୎଼ଥଋଦଆୗଏ୚ଶ୏୻ୄସ଴ରࡖଳ଴୳୺ପ୻ଖଛ଴୽୆୴ଌହ୷௣୅ଡା଺ରେ଱ୁୟେ୑୓ି୕ଅଲ࡜୉୴୺୳ଗ௢ଁଂଜଈ୹௠ଷୱୟଊ୹೮୻େ୚୿୔ୈଥ୛ଧ୎ହିୗଆୌ଺ଠଠଦࠧଷଢଏ୶ଊ୧ଢ଼ମ୕୆ୂୗହୋ଻ଁଂ࡞୾୅୼଄୽ୃଟଵ௠କ଄୲ମଳ୨ଉଐ଄ೱଅୟୗ୚ଵଈଠ࡞୺ୀ௡୹଒୑ଆଥ଩ପ଴ନࡐଧ୥଎଄ଡ଼ଇ଩୓୕୒ୌଧ୍ଅଣ୑ୗ଍ମୖିଋବ୘଴ࡏୱ୵୴ଔ୹଱୳଒୼ଚଲେଖ୿ଟଽ଄୛ନ୐଒ଯଧୟଁଶ୿ଯୖୈଭୃମଶଷ୓ୄ୐ଲଶ࡝଼ଽାହଘ௣௥ଵଇଭଖ೩଀୾ଫୖଠ୓୘଼୍ଲସଅ୞୒୚࡞ଖ଄ୀଲୈ௣଎ୁଽ௢଄୰୮ଂ୆ଃୁଣ୆େୈ୞୅࡛଺ଲ୸ଝ௡ଚୄଘ଑୸ଜ୼௣୧୫ଢଃଳ଴୓ୃ୔୍ࡘଙଇଜ୰ଚଗ୳୳ଽ୶଀ସଝ୼୎ೃଡ୘୘ରଲୋଯ୊ࡖ୰ବଂ଑୴ସ୰ଁ୳଼ଛିଘ୐୷ଐ୎୒୿ମ୞୿଱୓ୃࡕ଎୮ଭଚଫ୷ବଞ୷ୃ୸ୀ୼ସୗ୞ଧନ଎ୃଵ୔ଫସୄ଼ଢ୓ୗୁୃ࡚ࠉࡐࠌࡒ࡝ࡔࣣࣩ࣭࣠࠙ࠛ࠙ࠟࠄࡃ࡜ࡔࡐࡇࠉ࠙ࠍࠊࠞࠐࠐࡏࠨࠠࠦࠨࠣࠫ࠭ࠧࠨ࠮࠱ࠩࠪࡐࡍࡄ࠘ࠔࠉࠇࠛࠍࠍࡌࠥࠚ࣢ࠚࠛ࡜ࡓࠕࣦ࡛ࣥ࠙ࠖ࣪࣪࠴ࠎࠖࠎࠏࡐࡇࠚࠈࠏࠜࡌࠥࠇࡏ࠯ࠂ࠳࠺࠻ࡕࠑࣲ